import React from "react"
import { useFormikContext } from "formik"
import { CardContent, Typography, Box } from "@material-ui/core"
import { Divider } from "@mui/material"

export default function FormReview() {
	const { values } = useFormikContext()
	const array = Object.entries(values)

	return (
		<CardContent>
			<Box sx={{ display: "flex" }}>
				<Typography variant='h2' style={{ fontSize: "30px" }}>
					Review Details
				</Typography>
			</Box>
			<Box sx={{ margin: "20px" }}>
				{array.map((item, index) => {
					if (item[0]) {
						if (item[0] === "firstName") {
							item[0] = "First Name"
						}
						if (item[0] === "lastName") {
							item[0] = "Last Name"
						}
						if (item[0] === "email") {
							item[0] = "Email"
						}
						if (item[0] === "age") {
							item[0] = "Age"
						}
						if (item[0] === "compay") {
							item[0] = "Company"
						}
						if (item[0] === "address1") {
							item[0] = "Address 1"
						}
						if (item[0] === "address2") {
							item[0] = "Address 2"
						}
						if (item[0] === "city") {
							item[0] = "City"
						}
						if (item[0] === "province") {
							item[0] = "Province"
						}
						if (item[0] === "postalcode") {
							item[0] = "Postal Code"
						}
					}
					return (
						<div key={index}>
							<Typography
								variant='body1'
								style={{ fontSize: "15px", margin: "10px" }}>
								{item[0]}: {item[1]}
							</Typography>
							<Divider />
						</div>
					)
				})}
			</Box>
		</CardContent>
	)
}
